export const sorting = (arrayToOrder, orderBy) => arrayToOrder?.sort((a, b) => {
  // console.log(arrayToOrder);
    if (a[orderBy].toString().toLowerCase() < b[orderBy].toString().toLowerCase()) {
      return 1;
    }
    if (a[orderBy].toString().toLowerCase() > b[orderBy].toString().toLowerCase()) {
      return -1;
    }

    return 0;
  });
